import logo from './logo.svg';
import './App.css';
import GlobalApi from './GlobalApi';
import BookList from './bookList';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";



function App() {

  return (
    <div className="App">
      <button onClick={GlobalApi.baseInfoUpload}>Upload</button>
      <Router>
      <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>


    </div>
  );
}

export default App;
